import React, { useEffect, useState } from "react";
import { useParams, useNavigate, Link } from "react-router-dom";

const PlanSummary = () => {
  const { planId } = useParams();
  const navigate = useNavigate();
  const [plan, setPlan] = useState(null);
  const [loading, setLoading] = useState(true);

  // Dummy data - in a real app, you would fetch this from an API based on planId
  const plansData = [
    { id: "1", name: "Retirement Plan", startDate: "2025-01-01", endDate: "2055-01-01", projectedValue: 1250000 },
    { id: "2", name: "College Fund", startDate: "2025-06-01", endDate: "2043-08-01", projectedValue: 250000 },
    { id: "3", name: "Home Purchase", startDate: "2025-03-15", endDate: "2030-03-15", projectedValue: 180000 }
  ];

  useEffect(() => {
    // Simulate API call
    setTimeout(() => {
      const foundPlan = plansData.find(p => p.id === planId);
      setPlan(foundPlan || null);
      setLoading(false);
    }, 300);
  }, [planId]);

  const handleDelete = () => {
    // In a real app, you would send a delete request to the API
    alert(`Plan ${planId} would be deleted`);
    navigate('/');
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="text-xl text-purple-600">Loading plan details...</div>
      </div>
    );
  }

  if (!plan) {
    return (
      <div className="bg-red-50 p-8 rounded-xl text-center">
        <h2 className="text-2xl text-red-600 mb-4">Plan Not Found</h2>
        <p className="mb-6">The plan you're looking for doesn't exist or has been removed.</p>
        <Link to="/" className="bg-purple-600 hover:bg-purple-700 text-white py-2 px-4 rounded-lg">
          Return to Dashboard
        </Link>
      </div>
    );
  }

  return (
    <div className="max-w-3xl mx-auto mt-8 p-4">
      <Link to="/" className="text-purple-600 hover:text-purple-800 mb-6 inline-block">
        &larr; Back to All Plans
      </Link>

      <section className="bg-purple-100 rounded-2xl p-8 mb-8 shadow-md">
        <div className="flex justify-between items-start mb-6">
          <h2 className="text-purple-600 text-3xl font-bold">{plan.name}</h2>
          <div className="space-x-2">
            <Link 
              to={`/plans/${planId}/edit`} 
              className="bg-purple-600 hover:bg-purple-700 text-white py-2 px-4 rounded-lg inline-block"
            >
              Edit Plan
            </Link>
            <button 
              onClick={handleDelete}
              className="bg-red-600 hover:bg-red-700 text-white py-2 px-4 rounded-lg"
            >
              Delete Plan
            </button>
          </div>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-6">
          <div className="bg-white rounded-lg p-4 shadow-sm">
            <h3 className="text-purple-600 font-semibold mb-1">Start Date</h3>
            <p className="text-lg">{new Date(plan.startDate).toLocaleDateString()}</p>
          </div>

          <div className="bg-white rounded-lg p-4 shadow-sm">
            <h3 className="text-purple-600 font-semibold mb-1">End Date</h3>
            <p className="text-lg">{new Date(plan.endDate).toLocaleDateString()}</p>
          </div>

          <div className="bg-white rounded-lg p-4 shadow-sm">
            <h3 className="text-purple-600 font-semibold mb-1">Projected Value</h3>
            <p className="text-xl text-purple-700 font-bold">${plan.projectedValue.toLocaleString()}</p>
          </div>
        </div>
      </section>

      {/* Here you would include other components specific to the plan */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mt-8">
        {/* These components would pass planId as prop in a real implementation */}
      </div>
    </div>
  );
};

export default PlanSummary;
